            "\t<element name=\"SpecialNotes\" minOccurs=\"0\">\n\t\t\t\t<annotation>\n\t\t\t\t\t<documentatio" +
            "n>R_3.20 Vpišejo se morebitne druge oznake, ki podrobneje pojasnjujejo zapise v " +
