            "rson or if the invoice has been issued by the recipient of the invoice in the na" +
            "me of and on behalf of the supplier. If the invoice has not been issued in the n" +
            "ame of and on behalf of another person, the data is not entered.</documentation>" +
            "\n\t\t\t\t</annotation>\n\t\t\t</element>\n\t\t\t<element name=\"VAT\" type=\"fu:VATType\" minOcc" +
            "urs=\"0\" maxOccurs=\"unbounded\">\n\t\t\t\t<annotation>\n\t\t\t\t\t<documentation>Vpišejo se p" +
            "odatki o DDV. Podatek se posreduje le, če račun vsebuje znesek obračunanega DDV." +
            " Podatek je sestavljen iz davčne stopnje, davčne osnove in zneska davka. Za davč" +
            "ne stopnje lahko obstaja seznam davčnih stopenj pri davčnemu organu. / Data abou" +
            "t VAT are entered. The data is submitted only if the invoice  includes the amoun" +
            "t of VAT settled. The data consists of the tax rate, tax base and amount of tax." +
            " The tax authority may have a list of tax rates.</d")]
        public string FVI_ManyInvoices {
            get {
                return ((string)(this["FVI_ManyInvoices"]));
            }
            set {
                this["FVI_ManyInvoices"] = value;
            }
        }
        
