            "\t<element name=\"BusinessPremiseID\" type=\"fu:BusinessPremiseIDType\" minOccurs=\"1\"" +
            " maxOccurs=\"1\">\n\t\t\t\t<annotation>\n\t\t\t\t\t<documentation>Vpiše se oznaka poslovnega " +
            "prostora v katerem zavezanec izdaja račune pri gotovinskem poslovanju. Oznaka je" +
