            "\t</element>\n\t\t\t<element name=\"BPIdentifier\" type=\"fu:BPIdentifierType\" minOccurs" +
            "=\"1\" maxOccurs=\"1\">\n\t\t\t\t<annotation>\n\t\t\t\t\t<documentation>Vpišejo se podatki o ne" +
            "premičnem ali premičnem poslovnem prostoru. / Data are entered about immovable o" +
            "r movable business premises.</documentation>\n\t\t\t\t</annotation>\n\t\t\t</element>\n\t\t\t" +
            "<element name=\"ValidityDate\" type=\"fu:date\">\n\t\t\t\t<annotation>\n\t\t\t\t\t<documentatio" +
            "n>Datum začetka veljavnosti podatkov o poslovnem prostoru, ki se posredujejo. Po" +
            "datek se vpiše v obliki: LLLL-MM-DD. / The date when data about business premise" +
            "s, which are submitted, become valid. DD / The data is entered in the following " +
            "form: YYYY-MM-DD.</documentation>\n\t\t\t\t</annotation>\n\t\t\t</element>\n\t\t\t<element na" +
            "me=\"ClosingTag\" type=\"fu:ClosingTagType\" minOccurs=\"0\">\n\t\t\t\t<annotation>\n\t\t\t\t\t<d" +
            "ocumentation>Vpiše se podatek o zaprtju poslovnega prostora, če gre za trajno za" +
            "prtje. Možna je vrednost »Z«. Po zaprtju v tem poslovnem prostoru ni več možno i" +
