            "ovati davčnemu organu. / The data is entered about the closure of business premi" +
            "ses if the closure is permanent. The possible value is »Z«. After closure issuin" +
            "g invoices is not possible anymore in these business premises and it is not poss" +
            "ible to submit invoices to the tax authority with the mark of these business pre" +
            "mises.</documentation>\n\t\t\t\t</annotation>\n\t\t\t</element>\n\t\t\t<element name=\"Softwar" +
            "eSupplier\" type=\"fu:SoftwareSupplierType\" maxOccurs=\"1000\">\n\t\t\t\t<annotation>\n\t\t\t" +
            "\t\t<documentation>Vpiše se podatek o proizvajalcu  ali vzdrževalcu programske opr" +
            "eme za izdajanje računov. Vpiše se eden od podatkov: 1. Davčna številka pravne a" +
