            "oveniji  in 2. Naziv in naslov proizvajalca ali vzdrževalca programske opreme, k" +
            "i nima sedeža v Sloveniji. / The data is entered about the producer or software " +
            "maintenance provider for issuing invoices. One of the following data is entered:" +
            " 1. tax number of a legal entity or an individual – producer or software mainten" +
            "ance provider established in Slovenia and 2. title and address of the producer o" +
            "r software maintenance provider not established in Slovenia.</documentation>\n\t\t\t" +
            "\t</annotation>\n\t\t\t</element>\n\t\t\t<element name=\"SpecialNotes\" minOccurs=\"0\">\n\t\t\t\t" +
            "<annotation>\n\t\t\t\t\t<documentation>Vpišejo se morebitne druge oznake, ki podrobnej" +
            "e pojasnjujejo zapise v zvezi z vsebino podatkov o poslovnem prostoru. / Any oth" +
            "er potential marks are entered, which explain in detail the records in connectio" +
            "n with the content of data about business premises.</documentation>\n\t\t\t\t</annota" +
            "tion>\n\t\t\t\t<simpleType>\n\t\t\t\t\t<restriction base=\"string\">\n\t\t\t\t\t\t<minLength value=\"" +
            "1\"/>\n\t\t\t\t\t\t<maxLength value=\"1000\"/>\n\t\t\t\t\t</restriction>\n\t\t\t\t</simpleType>\n\t\t\t</" +
            "element>\n\t\t</sequence>\n\t</complexType>\n\t<complexType name=\"InvoiceType\">\n\t\t<anno" +
            "tation>\n\t\t\t<documentation>Račun / Invoice</documentation>\n\t\t</annotation>\n\t\t<seq" +
            "uence>\n\t\t\t<element name=\"TaxNumber\" type=\"fu:TaxNumberType\" minOccurs=\"1\" maxOcc" +
            "urs=\"1\">\n\t\t\t\t<annotation>\n\t\t\t\t\t<documentation>Vpiše se davčna številka zavezanca" +
