            "name=\"IssueDateTime\" type=\"fu:dateTime\" minOccurs=\"1\" maxOccurs=\"1\">\n\t\t\t\t<annota" +
            "tion>\n\t\t\t\t\t<documentation>Vpiše se datum in čas izdaje računa, ki je naveden na " +
            "računu. Podatek se vpiše v formatu LLLL-MM-DDTUU:MM:SS. / Date and time of issui" +
            "ng the invoice, which is stated on the invoice, are entered. The data is entered" +
            " in the following format YYYY-MM-DDTHH:MM:SS.\n</documentation>\n\t\t\t\t</annotation>" +
            "\n\t\t\t</element>\n\t\t\t<element name=\"NumberingStructure\" type=\"fu:NumberingStructure" +
            "Type\" minOccurs=\"1\" maxOccurs=\"1\">\n\t\t\t\t<annotation>\n\t\t\t\t\t<documentation>Vpiše se" +
            " oznaka načina dodeljevanja številk računom: C – centralno na nivoju poslovnega " +
            "prostora, B – po posamezni elektronski napravi (blagajna) Oznaka pojasnjuje na k" +
            "akšen način se računom dodeljujejo številke. Številke računov se lahko dodeljuje" +
            "jo centralno na nivoju poslovnega prostora ali posamično na elektronski napravi " +
            "za izdajanje računov. / The mark is entered for the method of assigning numbers " +
            "to invoices: C - centrally at the level of business premises, B - per individual" +
            " electronic device (cash register). The mark explains the method for assigning n" +
            "umbers to invoices. Invoice numbers may be assigned centrally at the level of bu" +
            "siness premises or individually on the electronic device for issuing invoices.</" +
            "documentation>\n\t\t\t\t</annotation>\n\t\t\t</element>\n\t\t\t<element name=\"InvoiceIdentifi" +
            "er\" type=\"fu:IdentifierType\" minOccurs=\"1\" maxOccurs=\"1\">\n\t\t\t\t<annotation>\n\t\t\t\t\t" +
            "<documentation>Vpiše se številka izdanega računa. Vpiše se tudi številka dokumen" +
            "ta, ki spreminja prvotni račun (dobropis, storno,…) v primeru izvajanja postopka" +
            " potrjevanja naknadne spremembe podatkov na računu, ki spreminja prvoten račun i" +
            "n se nanj nedvoumno nanaša. Številka računa je sestavljena iz treh delov: oznaka" +
            " poslovnega prostora; oznaka elektronske naprave za izdajanje računov; zaporedna" +
            " številka računa. Številka računa se na računu navede v naslednji obliki: oznaka" +
            " poslovnega prostora-oznaka elektronske naprave-zaporedna številka računa. Prime" +
            "r: TRGOVINA1-BLAG2-1234 Podatki se vpisujejo ločeno. / The number of the issued " +
            "invoice is entered. The number of the document is also entered, which changes th" +
            "e original invoice (credit, reversing, etc.) in cases of performing the procedur" +
            "e for verification of subsequent changes of data on the invoice, which changes t" +
            "he original invoice and refers to it with reasonable certainty. The invoice numb" +
            "er includes three parts: mark of business premises; mark of the electronic devic" +
            "e for issuing invoices; sequence number of the invoice. The invoice number is st" +
            "ated on the invoice in the following form: mark of business premises-mark of the" +
            " electronic device-sequence invoice number. Example: TRGOVINA1-BLAG2-1234. Data " +
            "are entered separately.</documentation>\n\t\t\t\t</annotation>\n\t\t\t</element>\n\t\t\t<elem" +
            "ent name=\"CustomerVATNumber\" type=\"fu:CustomerVATType\" minOccurs=\"0\" maxOccurs=\"" +
            "1\">\n\t\t\t\t<annotation>\n\t\t\t\t\t<documentation>Vpiše se davčna številka oziroma identi" +
            "fikacijska številka za namene DDV kupca oziroma naročnika v primeru, ko so ti po" +
            "datki v skladu z davčnimi predpisi navedeni na računu. Podatek se vpiše, če je n" +
            "aveden na računu. / The tax number is entered or identification number for VAT p" +
            "urposes of the buyer or ordering party in cases when these data are stated on th" +
            "e invoice in accordance with tax regulations.</documentation>\n\t\t\t\t</annotation>\n" +
            "\t\t\t</element>\n\t\t\t<element name=\"InvoiceAmount\" type=\"fu:AmountType\" minOccurs=\"1" +
            "\" maxOccurs=\"1\">\n\t\t\t\t<annotation>\n\t\t\t\t\t<documentation>Vnese se skupni znesek rač" +
            "una. Vpiše se znesek računa skupaj z DDV in ostalimi davki/dajatvami, zmanjšan z" +
            "a zneske popustov. Decimalno ločilo je pika. / The total amount of the invoice i" +
            "s entered. The amount of the invoice is entered together with VAT and other taxe" +
            "s/duties, decreased for amounts of discounts. The decimal separator is a dot.</d" +
            "ocumentation>\n\t\t\t\t</annotation>\n\t\t\t</element>\n\t\t\t<element name=\"ReturnsAmount\" t" +
            "ype=\"fu:AmountType\" minOccurs=\"0\" maxOccurs=\"1\">\n\t\t\t\t<annotation>\n\t\t\t\t\t<document" +
            "ation>Vpiše se znesek povračil na računu, ki se priznajo kupcu (npr. na podlagi " +
            "dobropisa za vračilo embalaže). Podatek se vpiše le, če na računu obstajajo povr" +
            "ačila. Decimalno ločilo je pika. / The amount of refunds on the invoice, which a" +
            "re recognized to the buyer (e.g. on the basis of credit for returning packaging)" +
            ", is entered. The data is entered only if there are refunds on the invoice. The " +
            "decimal separator is a dot.</documentation>\n\t\t\t\t</annotation>\n\t\t\t</element>\n\t\t\t<" +
            "element name=\"PaymentAmount\" type=\"fu:AmountType\" minOccurs=\"1\" maxOccurs=\"1\">\n\t" +
            "\t\t\t<annotation>\n\t\t\t\t\t<documentation>Vpiše se znesek računa za plačilo. Decimalno" +
            " ločilo je pika. / The amount of the invoice for payment is entered. The decimal" +
            " separator is a dot.</documentation>\n\t\t\t\t</annotation>\n\t\t\t</element>\n\t\t\t<element" +
            " name=\"TaxesPerSeller\" type=\"fu:TaxesPerSellerType\" maxOccurs=\"1000\">\n\t\t\t\t<annot" +
            "ation>\n\t\t\t\t\t<documentation>Vpiše se vrednost osnov po vrsti davka ali dajatve, r" +
            "azdeljeno po davčnih stopnjah, in pripadajoči davek ali dajatev, vrednost dobav " +
            "na podlagi posebnih ureditev, dobav pri katerih je plačnik DDV kupec blaga ali n" +
            "aročnik storitve, oproščenih dobav in neobdavčljivih dobav, ločeno po davčnih št" +
            "evilkah davčnih zavezancev. / The value is entered for bases according to types " +
            "of taxes or duties, separated per tax rates, and associated taxes or duties, val" +
            "ue of supplies on the basis of special arrangements, supplies where the payer of" +
            " VAT is the buyer of goods or party ordering services, exempt supplies and non-t" +
            "axable supplies, separated according to tax numbers of taxpayers.</documentation" +
            ">\n\t\t\t\t</annotation>\n\t\t\t</element>\n\t\t\t<element name=\"OperatorTaxNumber\" type=\"fu:" +
            "TaxNumberType\" minOccurs=\"0\" maxOccurs=\"1\">\n\t\t\t\t<annotation>\n\t\t\t\t\t<documentation" +
            ">Vpiše še davčna številka fizične osebe (operaterja), ki izda račun z uporabo el" +
            "ektronske naprave za izdajanje računov. V primeru izdaje računa preko samopostre" +
            "žnih elektronskih naprav oziroma ko se račun izda brez prisotnosti fizične osebe" +
            ", se vpiše davčna številka zavezanca. Če oseba nima slovenske davčne številke, s" +
            "e podatek ne vpisuje. / The tax number is entered of the individual (operator), " +
            "who issues the invoice with the usage of the electronic device for issuing invoi" +
            "ces. In cases of issuing invoices via self-service electronic devices or when in" +
            "voices are issued without the presence of individuals, the tax number of the per" +
            "son liable is entered. The data is not entered if the person has no Slovene tax " +
            "number.</documentation>\n\t\t\t\t</annotation>\n\t\t\t</element>\n\t\t\t<element name=\"Foreig" +
            "nOperator\" type=\"boolean\" minOccurs=\"0\" maxOccurs=\"1\">\n\t\t\t\t<annotation>\n\t\t\t\t\t<do" +
            "cumentation>Vpiše se true, če fizična oseba (operater), ki izda račun z uporabo " +
            "elektronske naprave, nima slovenske davčne številke, drugače false (1 - true, 0 " +
            "– false). / You enter »true« if the individual (operator), who issues the invoic" +
            "e with the usage of the electronic device, has no Slovene tax number, otherwise " +
            "»false« (1 – true, 0 – false).</documentation>\n\t\t\t\t</annotation>\n\t\t\t</element>\n\t" +
            "\t\t<element name=\"ProtectedID\" minOccurs=\"1\" maxOccurs=\"1\">\n\t\t\t\t<annotation>\n\t\t\t\t" +
            "\t<documentation>Vpiše se zaščitna oznaka izdajatelja računa. Zaščitna oznaka je " +
